const themePresets = [
  // ðŸ”† Bright Yellow tones
  { value: 'theme-yellow-dark', label: 'Golden Eclipse',  accent: '#E3A500', text: '#FFF7B0' },
  { value: 'theme-yellow',      label: 'Golden Ember',    accent: '#E3A500', text: '#2C2C2C' },

  // ðŸŒ¹ Romantic & Warm
  { value: 'theme-rose',        label: 'Crimson Rose',    accent: '#88304E', text: '#ffffff' },
  { value: 'theme-rosewood',    label: 'Rosewood Velvet', accent: '#EF88AD', text: '#FFF3F7' },
  { value: 'theme-ember',       label: 'Amber Ember',     accent: '#AB4459', text: '#FFF9F0' },
  { value: 'theme-inferno',     label: 'Inferno Burst',   accent: '#FF7600', text: '#FFF2E5' },
  { value: 'theme-crimson',     label: 'Crimson Blaze',   accent: '#A0153E', text: '#FDECEC' },

  // ðŸ’œ Deep Purples & Violets
  { value: 'theme-violet',      label: 'Royal Violet',    accent: '#720455', text: '#f4f0ff' },
  { value: 'theme-plum',        label: 'Mulberry Mist',   accent: '#6A1E55', text: '#f7ecf4' },
  { value: 'theme-amethyst',    label: 'Amethyst Dream',  accent: '#FFACAC', text: '#FFF5F9' },

  // ðŸŒ¿ Earthy & Natural
  { value: 'theme-olive',       label: 'Verdant Olive',   accent: '#97B067', text: '#f7fff8' },
  { value: 'theme-forest',      label: 'Emerald Forest',  accent: '#1abc9c', text: '#e9fff1' },
  { value: 'theme-mint',        label: 'Coral Mint',      accent: '#FF847C', text: '#0b0f12' },

  // ðŸŒŠ Cool & Oceanic
  { value: 'theme-ocean',       label: 'Deep Ocean',      accent: '#1f6feb', text: '#e7f6ff' },
  { value: 'theme-slate',       label: 'Midnight Slate',  accent: '#a6adc8', text: '#f1f5f9' },

  // ðŸŒ… Warm & Vibrant
  { value: 'theme-sunset',      label: 'Amber Dusk',      accent: '#ffb86b', text: '#fff4ee' },
  { value: 'theme-vibrant',     label: 'Vibrant Warm',    accent: '#E17A47', text: '#061016' },
  { value: 'theme-blush',       label: 'Blush Tide',      accent: '#56BEA6', text: '#10222b' },
  
  // root
  { value: 'root',        label: 'Root Chakra',     accent: '#61dafb', text: '#f5f5f5' }

];

export default themePresets;
